import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom";
const Home = () => {
   const navigate = useNavigate();
   const admin = localStorage.getItem('admin');
   
   if(!admin) {
       navigate('/login');
   }
   return(
      <h3>Home Page</h3>
   )
}
export default Home;
